import React from "react";

const EmployeeCalculateSalary = () => {
  return (
    <div className="ui grid">
      <div className="one wide column"></div>
      <div className="fourteen wide column">
        <div class="ui segment">
          <p>Top</p>
        </div>
        <div class="ui segment">
          <p>Middle</p>
        </div>
        <div class="ui segment">
          <p>Middle</p>
        </div>
        <div class="ui segment">
          <p>Middle</p>
        </div>
        <div class="ui segment">
          <p>Bottom</p>
        </div>
      </div>
    </div>
  );
};

export default EmployeeCalculateSalary;
